import React from 'react';
import { useNavigate } from 'react-router-dom';
import Parse from 'parse';

const Dashboard = () => {
  const navigate = useNavigate();
  const currentUser = Parse.User.current();

  // Logout Function
  const handleLogout = async () => {
    await Parse.User.logOut();
    navigate('/login');
  };

  if (!currentUser) {
    return <div style={{backgroundColor: '#0a192f', height: '100vh', color: 'red', textAlign: 'center', paddingTop: '50px'}}>Access Denied!</div>;
  }

  // ·Äí·Ä´·ÄÄ Zoom Link ·Äî·Ä≤·Ä∑ Schedule ·Äï·Ä´
  const classSchedule = [
    { 
      subject: "Linux for Hackers", 
      time: "07:00 PM - 09:00 PM (Today)", 
      status: "Live Now", 
      zoomLink: "https://zoom.us/j/your_meeting_id" // ·Äê·ÄÄ·Äö·Ä∑·Ä∫ Link ·Äë·Ää·Ä∑·Ä∫·Äõ·Äî·Ä∫
    },
    { 
      subject: "Network Pentesting", 
      time: "Monday, 08:00 PM", 
      status: "Upcoming", 
      zoomLink: "#" 
    }
  ];

  return (
    <div style={{ backgroundColor: '#0a192f', minHeight: '100vh', color: '#ccd6f6', fontFamily: 'sans-serif' }}>
      {/* Navbar */}
      <nav style={styles.nav}>
        <h2 style={{ color: '#00ff41', margin: 0 }}>CS_SCHOOL</h2>
        <div style={{ display: 'flex', alignItems: 'center', gap: '20px' }}>
          <span>Agent: <span style={{color: '#00ff41'}}>{currentUser.get('username')}</span></span>
          <button onClick={handleLogout} style={styles.logoutBtn}>LOGOUT</button>
        </div>
      </nav>

      <div style={{ padding: '40px 10%' }}>
        <h1 style={{ color: '#00ff41' }}>Live Class Terminal</h1>
        <p style={{ color: '#8892b0', marginBottom: '40px' }}>·Äö·Äî·Ä±·Ä∑·Äê·ÄÄ·Ä∫·Äõ·Ä±·Ä¨·ÄÄ·Ä∫·Äõ·Äô·Ää·Ä∑·Ä∫ Zoom ·Ä°·Äê·Äî·Ä∫·Ä∏·Äô·Äª·Ä¨·Ä∏·ÄÄ·Ä≠·ÄØ ·Äí·ÄÆ·Äô·Äæ·Ä¨·ÄÄ·Äº·Ää·Ä∑·Ä∫·Äï·Ä´·Åã</p>

        <div style={styles.grid}>
          {classSchedule.map((item, index) => (
            <div key={index} style={{
              ...styles.card,
              borderColor: item.status === "Live Now" ? '#00ff41' : '#233554'
            }}>
              <div style={styles.badge(item.status)}>{item.status}</div>
              <h2 style={{ marginTop: '10px' }}>{item.subject}</h2>
              <p style={{ color: '#8892b0' }}>üïí {item.time}</p>

              <hr style={{ border: '0.1px solid #233554', margin: '20px 0' }} />

              {item.status === "Live Now" ? (
                <a href={item.zoomLink} target="_blank" rel="noreferrer" style={styles.joinBtn}>
                  JOIN ZOOM MEETING
                </a>
              ) : (
                <button style={styles.disabledBtn} disabled>NOT STARTED YET</button>
              )}
            </div>
          ))}
        </div>

        {/* Announcement Section */}
        <div style={styles.announcement}>
          <h3 style={{ color: '#00ff41' }}>‚ö†Ô∏è System Announcement</h3>
          <p>Zoom Meeting ·Äù·ÄÑ·Ä∫·Äê·Ä≤·Ä∑·Ä°·ÄÅ·Ä´ ·ÄÄ·Ä≠·ÄØ·Äö·Ä∑·Ä∫·Äõ·Ä≤·Ä∑ Username ·ÄÄ·Ä≠·ÄØ Backend ·ÄÄ ·Äî·Ä¨·Äô·Ää·Ä∫·Ä°·Äê·Ä≠·ÄØ·ÄÑ·Ä∫·Ä∏ ·Äï·Ä±·Ä∏·Äï·Ä±·Ä∏·Äï·Ä´·Äõ·Äî·Ä∫·Åã</p>
        </div>
      </div>
    </div>
  );
};

const styles = {
  nav: { display: 'flex', justifyContent: 'space-between', padding: '15px 10%', background: '#112240', alignItems: 'center', borderBottom: '2px solid #00ff41' },
  logoutBtn: { background: 'transparent', color: '#ff4b2b', border: '1px solid #ff4b2b', padding: '5px 15px', borderRadius: '5px', cursor: 'pointer' },
  grid: { display: 'grid', gridTemplateColumns: 'repeat(auto-fit, minmax(300px, 1fr))', gap: '30px' },
  card: { background: '#112240', padding: '30px', borderRadius: '15px', border: '1px solid', position: 'relative' },
  badge: (status) => ({
    display: 'inline-block',
    padding: '5px 12px',
    borderRadius: '20px',
    fontSize: '12px',
    fontWeight: 'bold',
    background: status === "Live Now" ? '#00ff41' : '#233554',
    color: status === "Live Now" ? '#0a192f' : '#8892b0'
  }),
  joinBtn: { 
    display: 'block', textAlign: 'center', background: '#00ff41', color: '#0a192f', 
    textDecoration: 'none', padding: '12px', borderRadius: '5px', fontWeight: 'bold', 
    boxShadow: '0 0 15px #00ff4166' 
  },
  disabledBtn: { width: '100%', padding: '12px', borderRadius: '5px', background: '#233554', color: '#8892b0', border: 'none', cursor: 'not-allowed' },
  announcement: { marginTop: '50px', padding: '20px', background: '#0a192f', border: '1px dashed #00ff41', borderRadius: '10px' }
};

export default Dashboard;
